      }))
    },
    [store]
  )

  const insertScreenInstance = useCallback(
    ({
      ptr,
      screenInstance,
    }: {
      ptr: number
      screenInstance: {
        id: string
        screenId: string
        present: boolean
        as: string
      }
    }) => {
      store.setState((prevState) => ({
        ...prevState,
        screenInstances: [
          ...prevState.screenInstances.filter((_, i) => i <= ptr),
          {
            ...screenInstance,
            nestedRouteCount: 0,
          },
        ],
      }))
    },
    [store]
  )

  const increaseScreenInstancePtr = useCallback(() => {
    store.setState((prevState) => ({
      ...prevState,
      screenInstancePtr: prevState.screenInstancePtr + 1,
    }))
