  const setScreenInstancePtr = useCallback(
    ({ ptr }: { ptr: number }) => {
      store.setState((prevState) => ({
        ...prevState,
        screenInstancePtr: ptr,
      }))
    },
    [store]
  )

  return useMemo(
    () => ({
      registerScreen,
      addScreenInstanceOption,
      addScreenInstancePromise,
      mapScreenInstance,
      insertScreenInstance,
      increaseScreenInstancePtr,
      setScreenInstancePtr,
    }),
    [
      registerScreen,
      addScreenInstanceOption,
      addScreenInstancePromise,
      mapScreenInstance,
      insertScreenInstance,
      increaseScreenInstancePtr,
      setScreenInstancePtr,
    ]
  )
}
