          <NodeRef<HTMLDivElement> key={screenInstanceIndex}>
            {(nodeRef) => (
              <CSSTransition
                key={screenInstance.id}
                nodeRef={nodeRef}
                timeout={props.animationDuration}
                in={screenInstanceIndex <= screenInstancePtr}
                classNames={{
